INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 7, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 7, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 7, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 10, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 10, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 10, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, 10, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 12, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 13, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 13, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, 13, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 13, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 14, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, 14, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 14, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 14, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 15, -470.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, 16, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 16, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 16, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 16, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 17, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 25, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 25, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, 25, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 25, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 1, 190801, 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 18, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 2, 190801, 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 18, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 3, 190801, 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 19, -470.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 4, 190801, 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 19, -470.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 5, 190801, 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 20, -470.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 6, 190801, 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 20, -470.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 21, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 21, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, 21, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 21, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 1, 190801, 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 22, -430.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 2, 190801, 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 22, -430.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 3, 190801, 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 23, -430.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 4, 190801, 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 23, -430.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 1, 109001, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 4.08, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 2, 109001, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 5.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 3, 109001, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 10.11, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 4, 109001, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 4.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 5, 109001, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 6.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 6, 109002, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 7, 109002, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 8, 109002, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 9, 109002, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("エリコ（バレンタイン）", 0, 10011, 10, 109002, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 1, 109101, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 2.12, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 2, 109101, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 4.19, "2019/01/31 12:00:00", 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 3, 109101, 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, 24, -385.0, "2030/12/17 14:59:59", 4, 2.3, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 4, 109102, 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 5, 109101, 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 5.23, "2019/01/31 12:00:00", 5);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 6, 109102, 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 7, 109101, 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, 24, -385.0, "2030/12/17 14:59:59", 2, 5.01, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 8, 109102, 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 9, 109102, 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル（バレンタイン）", 0, 10011, 10, 109102, 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 24, 0.0, "2030/12/17 14:59:59", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, 26, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0.0, 26, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0.0, 26, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0.0, 26, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0.0, 27, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0.0, 27, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0.0, 27, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 27004, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0.0, 27, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 1, 190801, 28001, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0.0, 28, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 2, 190801, 28002, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 0.0, 28, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 3, 190801, 29001, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 0.0, 29, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 4, 190801, 29002, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0.0, 29, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 5, 190801, 30001, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0.0, 30, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 6, 190801, 30002, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0.0, 30, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/09/24 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 7, 190801, 31001, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0.0, 31, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/10/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 8, 190801, 31002, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0.0, 31, -409.0, "2030/12/17 14:59:59", 1, 0.0, "2019/10/31 12:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 1, 190801, 32001, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0.0, 32, -409.0, "2020/01/04 4:59:59", 1, 0.0, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 2, 190801, 32002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 32, -409.0, "2020/01/04 4:59:59", 1, 0.0, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 3, 190801, 33001, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0.0, 33, -409.0, "2020/01/04 4:59:59", 1, 0.0, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 4, 190801, 33002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0.0, 33, -409.0, "2020/01/04 4:59:59", 1, 0.0, "2019/12/20 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 5, 190801, 34001, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0.0, 34, -409.0, "2020/01/10 11:59:59", 1, 0.0, "2020/01/04 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 6, 190801, 34002, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0.0, 34, -409.0, "2020/01/10 11:59:59", 1, 0.0, "2020/01/04 5:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 38001, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 0.0, 38, -458.0, "2030/12/17 14:59:59", 2, 5.3, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 2, 105801, 38002, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 0.0, 38, -458.0, "2030/12/17 14:59:59", 2, 6.5, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 0, 105801, 39005, "", 9999.0, 39, 9999.0, "2020/04/08 23:59:59", 3, 0.0, "2020/04/01", 3);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("カリン", 0, 0, 2, 190801, 40001, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0.0, 40, -430.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 41001, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 0.0, 41, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 41002, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0.0, 41, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 41003, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0.0, 41, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 41004, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0.0, 41, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 42001, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0.0, 42, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シェフィ", 2104010, 0, 1, 106401, 42002, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 0.0, 42, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 42003, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0.0, 42, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 42004, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0.0, 42, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("ペコリーヌ", 0, 0, 1, 105801, 43001, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0.0, 43, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("コッコロ", 0, 0, 1, 105901, 43002, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0.0, 43, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("キャル", 0, 0, 1, 106001, 43003, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0.0, 43, -363.0, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", 0, 0, 1, 123001, 43004, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0.0, 44, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", 0, 0, 2, 123001, 43005, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0.0, 44, -416.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", 0, 0, 3, 123001, 43006, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0.0, 45, -416.5, "2030/12/17 14:59:59", 2, 5.79, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("アメス", 0, 0, 1, 123001, 46001, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0.0, 46, -371.5, "2030/12/17 14:59:59", 1, 0.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("シズル", 0, 0, 1, 104901, 47001, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0.0, 47, -416.5, "2030/12/17 14:59:59", 2, 0.0, "2015/12/17 15:00:00", 2);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES ("リノ", 0, 0, 1, 101101, 47002, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 0.0, 47, -416.5, "2030/12/17 14:59:59", 2, 9.32, "2015/12/17 15:00:00", 1);
